svg.script:
function showTooltip(evt, x, y) {
  var tooltip = document.getElementById('svg-tooltip');
  tooltip.setAttribute('x', evt.offsetX + 10);
  tooltip.setAttribute('y', evt.offsetY + 10);
  tooltip.textContent = 'x: ' + x.toFixed(2) + ', y: ' + y.toFixed(2);
  tooltip.style.display = 'block';
}
function hideTooltip() {
  var tooltip = document.getElementById('svg-tooltip');
  tooltip.style.display = 'none';
}
